import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";

import { Rasp } from "../components/Rasp/index";
import { Time } from "../components/Time";
import { Day } from "../components/Day";
import { Predmet } from "../components/Predmet";

import { fetchRasps } from "../redux/slices/rasps";
import { fetchTimes } from "../redux/slices/times";
import {fetchPredmets} from "../redux/slices/predmets"


export const Home = () => {
  const dispatch = useDispatch();
  const userData = useSelector((state) => state.auth.data);
  const { rasps } = useSelector((state) => state.rasps);
  const { times } = useSelector((state) => state.times);
  const { predmeds } = useSelector((state)  => state.predmeds );

  const [selectedTab, setSelectedTab] = useState(0); // Durum değişikliği

  useEffect(() => {
    dispatch(fetchRasps());
    dispatch(fetchTimes());
    dispatch(fetchPredmets());
  }, []);

  // Rasps ve times yüklenene kadar bekleyen loading state
  const isRaspsLoading = rasps.status === "loading";
  const isTimesLoading = times.status === "loading";
  const isPredmetsLoading = predmeds.status === "loading";

  const handleTabChange = (event, newValue) => {
    setSelectedTab(newValue);
  };

  console.log(days);
  return (
    <>
      <Tabs
        style={{ marginBottom: 15 }}
        value={selectedTab}
        onChange={handleTabChange}
        aria-label="basic tabs example"
      >
        <Tab label="Расписания" />
        <Tab label="Время" />
        <Tab label="Предмет" />
      </Tabs>

      <div className="columns mt-5">
  <div>
    {selectedTab === 0 && (
      <table>
        <thead>
          <tr>
            <th>Time</th>
            <th>Day</th>
            <th>Predmed</th>
            <th>Group</th>
            <th>Teacher</th>
            <th>Kurs</th>
            <th>Room</th>
          </tr>
        </thead>
        <tbody>
          {isRaspsLoading ? (
            [...Array(50)].map((_, index) => (
              <Rasp key={index} isLoading={true} />
            ))
          ) : (
            rasps.items.map((obj) => (
              <Rasp
                key={obj._id}
                id={obj._id}
                time={obj.time.time}
                day={obj.day.day}
                predmed={obj.predmed}
                group={obj.group}
                teacher={obj.teacher}
                kurs={obj.kurs}
                room={obj.room}
                isEditable={userData?._id === obj.user._id}
              />
            ))
          )}
        </tbody>
      </table>
    )}
    {selectedTab === 1 && (
      <table>
        <thead>
          <tr>
            <th>Время</th>
            {selectedTab === 1 &&
            (isTimesLoading ? (
              <p>Loading...</p>
            ) : (
              times.items.map((time) => (
                <Time
                  key={time._id}
                  id={time._id}
                  time={time.time}
                  isEditable={userData?._id === time.user._id}
                />
              ))
            ))}
          </tr>
        </thead>
        <tbody>
          {/* Time bileşenlerini buraya ekleyin */}
        </tbody>
      </table>
    )}
    {selectedTab === 2 && (
      <table>
        <thead>
          <tr>
            <th>Предмет</th>
            {selectedTab === 2 &&
            (isDaysLoading ? (
              [...Array(50)].map((_, index) => (
                <Rasp key={index} isLoading={true} />
              ))
            ) : (
              days.items.map((day) => (
                <Day
                  key={day._id}
                  id={day._id}
                  day={day.day}
                  isEditable={userData?._id === day.user._id}
                />
              ))
            ))}
          </tr>
        </thead>
      </table>
    )}
  </div>
</div>

</>
  );
};
